import React from "react";
import './Navbar.css'

function Navbar() {
    return(
            <nav>
                <div id="site-name">
                    <i className="fa fa-map-pin" style={{marginLeft: 16}}></i>
                    <h3>Kazoogle</h3>
                </div>
            </nav>
    )
}

export default Navbar;
